Felt like these are finally getting a chance to shine after a crazy 30 days.

30 days ago Alex went in for emergency surgery in Indonesia after sitting with a ruptured appendix for 12 hours. Which also prompted our early journey back home to the states alongside a trigger fest of emotions.

It makes you really think about your angels, the universe’s destiny and our perspective on experiences we live through.

Looking back over the last few months, our life has changed… a lot. And with the changes come really freakin incredible lessons. These lessons have been bubbling over all the doing of our days and have kept us in the being, the present.

The only reason I share is so you know you’re never alone. That your present self is the most loving, courageous version. You never know what you can endure. You also never know how strong you are until strength is your only option.

Sending love and presence (and wedding mushy photos) to you this Sunday 🥹🤌🤍

