a month has gone since returning home from RE | TREAT Mexico. a vision turned to reality just because i was willing to let go, trust, lead with love, and honor intention.

this crew means more than I can express in the human language. and more than we could capture in a 2 minute video. it’s a privilege to have brought them together, celebrated, held space for, connected…

what this RE | TREAT showed me is beyond this little corner of the web. it reminded how true vulnerability leads to rooted connection. how trying to know what’s next actually creates limits. and how when you’re simply you, you find wholeness.

it affirmed the trust of “going without knowing” + watch the magic unfold (I see you my perfectionists, lean in).

to this crew — thank you. for trusting, opening, belly laughing, sobbing, and walking through seaweed to find what actually lights you up. where your vision lies — not in the things, but in the feelings, like xo.

RE | TREAT ‘24, you’re up.

